B.we=new A.at("TAL_3","Klettern","Ohne Schwierigkeiten und viel schneller als gew\xf6hnlich hat der Held den Aufstieg geschafft. Zuschauer halten ihn f\xfcr den besten Kletterer Deres. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held rutscht ab und f\xe4llt (siehe Seite 340, Sturzschaden).",B.X,B.ab,B.aF,2,"klettern")
B.ai=new A.fA("KO",6,"konstitution")
B.wk=new A.at("TAL_4","K\xf6rperbeherrschung","Dem Held gelingt seine Handlung und er hat noch eine zus\xe4tzliche Aktion zur Verf\xfcgung. Und was immer der Held getan hat: Es sah elegant aus.","Der Held st\xfcrzt und erleidet Schaden (1W6 SP).",B.ab,B.ab,B.ai,3,"koerperbeherrschung")
B.w8=new A.at("TAL_5","Kraftakt","Der Held beeindruckt durch seine Muskelkraft alle Zuschauer und gilt fortan als einer der st\xe4rksten Aventurier. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Die Handlung des Helden misslingt v\xf6llig. Er st\xfcrzt, verhebt sich o.\xc4. und verletzt sich dabei (1W6 SP).",B.ai,B.aF,B.aF,4,"kraftakt")
B.vZ=new A.at("TAL_6","Reiten","Das Tier macht seine Sache ausgezeichnet und wie gew\xfcnscht, der Reiter hat eine weitere Aktion zur Verf\xfcgung.","Das Tier wirft den Reiter ab und er st\xfcrzt zu Boden (siehe Seite **340**, Sturzschaden).",B.a0,B.ab,B.aF,5,"reiten")
B.vX=new A.at("TAL_7","Schwimmen","Der Held schwimmt die Strecke in Bestzeit. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held geht unter (siehe Seite 340ff., Erstickungsschaden). Grund daf\xfcr k\xf6nnte ein Wadenkrampf sein.",B.ab,B.ai,B.aF,6,"schwimmen")
B.vW=new A.at("TAL_8","Selbstbeherrschung","Es gelingt dem Helden, Schmerzen (bis Stufe III) und Ablenkungen einen ganzen Tag lang zu ignorieren.","Der Held erh\xe4lt f\xfcr die n\xe4chste Stunde 2 Stufen des Zustands *Schmerz* oder ist durch die Ablenkung *\xdcberrascht*.",B.X,B.X,B.ai,7,"selbstbeherrschung")
B.t=new A.fA("KL",1,"klugheit")
B.vY=new A.at("TAL_9","Singen","Der Gesang des Helden ist noch in vielen Wochen Thema seiner Zuh\xf6rer. Hat der Held sich um Geld bem\xfcht, dann nimmt er mindestens das Doppelte ein als \xfcblich. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held liegt mehrere Halbt\xf6ne daneben oder vergeigt den Rhythmus. Das Lied ist eine Qual f\xfcr jeden Zuh\xf6rer, der Held wird ausgebuht.",B.t,B.a0,B.ai,8,"singen")
B.vF=new A.at("TAL_10","Sinnessch\xe4rfe","Der Held nimmt sogar kaum bemerkbare Details wahr. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held nimmt etwas anderes wahr, als das, was wirklich wichtig w\xe4re. Er k\xf6nnte zum Beispiel die in der N\xe4he befindlichen Blumen riechen, daf\xfcr aber nicht den auff\xe4llig stinkenden Oger, der an ihn heranschleicht.",B.t,B.w,B.w,9,"sinnesschaerfe")
B.w_=new A.at("TAL_11","Tanzen","Die Aufmerksamkeit der Zuschauer f\xe4llt wegen des perfekten Tanzes auf den Helden. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held tritt seiner Tanzpartnerin auf die F\xfc\xdfe und verletzt sie dabei oder er st\xfcrzt und blamiert sich.",B.t,B.a0,B.ab,10,"tanzen")
B.w5=new A.at("TAL_12","Taschendiebstahl","Das Opfer hat den Diebstahlversuch nicht bemerkt und der Held hat besonders wertvolle Beute gemacht oder gleich mehrere Ziele bestohlen. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held wird von umstehenden Personen oder dem Opfer beobachtet, ohne es zu bemerken, und der Diebstahlversuch misslingt. Au\xdferdem ist er *\xdcberrascht*.",B.X,B.K,B.ab,11,"taschendiebstahl")
B.wm=new A.at("TAL_13","Verbergen","Der Held hat ein perfektes Versteck gefunden oder ist lautlos wie eine Katze. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Irgendetwas (Teller, ein M\xf6belst\xfcck) ist umgefallen.",B.X,B.w,B.ab,12,"verbergen")
B.wc=new A.at("TAL_14","Zechen","Dem Helden gelingt es, bis zum bitteren Ende durchzuhalten, und trotzdem geht es ihm am n\xe4chsten Morgen blendend.","Der Held begeht in seinem Zustand jedwede Peinlichkeit. Er zerlegt die halbe Taverne, wacht morgens nackt auf dem Markt oder in einem fremden Bett auf, plaudert Geheimnisse an den Feind aus und kann sich danach an nichts mehr erinnern.",B.t,B.ai,B.aF,13,"zechen")
B.Bk=new A.dv(58094,"MaterialIcons",null,!1)
B.Jw=new A.hJ("Gesellschafts\xadtalente",B.Bk,1,"gesellschaftstalente")
B.w0=new A.at("TAL_15","Bekehren & \xdcberzeugen","Das Opfer der \xdcberzeugungsversuche ist vollends \xfcberzeugt.","Das Opfer f\xfchlt sich vom Prediger beleidigt oder f\xfcr dumm verkauft.",B.X,B.t,B.a0,14,"bekehrenUndUeberzeugen")
B.vL=new A.at("TAL_16","Bet\xf6ren","Das Verf\xfchrungsopfer versucht, dem bet\xf6renden Helden alle W\xfcnsche zu erf\xfcllen.","Der Held kassiert eine schallende Ohrfeige f\xfcr seinen plumpen Anmachversuch.",B.X,B.a0,B.a0,15,"betoeren")
B.vB=new A.at("TAL_17","Einsch\xfcchtern","Das Gegen\xfcber des Helden ist vollkommen eingesch\xfcchtert und wird in absehbarer Zeit nichts mehr gegen den Helden unternehmen.","Anstatt eingesch\xfcchtert oder beleidigt zu sein, geschieht das Gegenteil: Das Opfer ist w\xfctend, v\xf6llig gelassen oder am\xfcsiert. Oder der Held macht sich mit seinem Gehabe v\xf6llig zum Affen.",B.X,B.w,B.a0,16,"einschuechtern")
B.wb=new A.at("TAL_18","Etikette","Auf der Feier ist der Held aufgrund seines Benehmens, Wortwitzes und Charmes der Mittelpunkt.","Der Held beleidigt mit seinem Verhalten eine wichtige Pers\xf6nlichkeit.",B.t,B.w,B.a0,17,"etikette")
B.vt=new A.at("TAL_19","Gassenwissen","Der Held entdeckt ein besonders gutes, aber g\xfcnstiges Gasthaus, erh\xe4lt mehr Informationen, als er erwartet hat, oder es gelingt ihm, einen Kontaktmann zu finden, der ihm exzellente Konditionen anbietet.","Der Held ger\xe4t in den Hinterhalt einer Bande Schurken, die ihn auspl\xfcndern wollen.",B.t,B.w,B.a0,18,"gassenwissen")
B.vz=new A.at("TAL_20","Menschenkenntnis","Der Held durchschaut die Person komplett.","Der Held ist einer kompletten Fehleinsch\xe4tzung aufgesessen. So k\xf6nnte er beispielsweise einem L\xfcgner wirklich alles glauben, ehrlichen Leuten hingegen kein Wort.",B.t,B.w,B.a0,19,"menschenkenntnis")
B.wf=new A.at("TAL_21","\xdcberreden","Die Person, die der Held \xfcberreden wollte, tut weit mehr als sie muss.","Die Person, die der Held \xfcberreden wollte, ist w\xfctend auf den Helden und l\xe4sst sich in n\xe4chster Zeit nicht mehr \xfcberreden.",B.X,B.w,B.a0,20,"ueberreden")
B.vs=new A.at("TAL_22","Verkleiden","Die Verkleidung funktioniert tadellos.","Die Kleidung wird sofort durchschaut und der Held handelt sich in der Regel \xc4rger ein.",B.w,B.a0,B.ab,21,"verkleiden")
B.vI=new A.at("TAL_23","Willenskraft","Der Held widersteht und kann von dieser Person oder Sache in n\xe4chster Zeit nicht mehr beeinflusst werden.","Der Held ist der Person, die ihn beeinflussen will, vollkommen verfallen oder f\xe4llt bei Anblick eines scheu\xdflichen D\xe4mons in Ohnmacht.",B.X,B.w,B.a0,22,"willenskraft")
B.Bn=new A.dv(58952,"MaterialIcons",null,!1)
B.Jv=new A.hJ("Naturtalente",B.Bn,2,"naturtalente")
B.vE=new A.at("TAL_24","F\xe4hrtensuchen","Sofern die Spur nicht komplett zerst\xf6rt wurde, kann der Held ihr zielsicher bis zum Ende folgen. Er erh\xe4lt mehr Informationen als \xfcblich. T\xe4uschungsman\xf6ver wie das Verwischen der Spuren durchschaut er sofort.","Der Held verwechselt die Spur und folgt einer falschen F\xe4hrte. So trifft er vielleicht auf eine gef\xe4hrliche Kreatur oder jagt den falschen Leuten hinterher.",B.X,B.w,B.ab,23,"faehrtensuchen")
B.wh=new A.at("TAL_25","Fesseln","Der Held hat einen stabilen Knoten gemacht. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held hat einen Knoten gemacht, der sich in jeder Lage l\xf6st - oder der denkbar ung\xfcnstigsten.",B.t,B.K,B.aF,24,"fesseln")
B.vO=new A.at("TAL_26","Fischen & Angeln","Die Zahl der Rationen ist sehr hoch. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Angler f\xe4llt ins Wasser und die Angel geht verloren.",B.K,B.ab,B.ai,25,"fischenUndAngeln")
B.vV=new A.at("TAL_27","Orientierung","Der Held findet den Weg ohne Schwierigkeiten selbst unter schlechtesten Bedingungen.","Der Held hat sich komplett verlaufen und bewegt sich in die falsche Richtung, was ihm jedoch nicht bewusst ist.",B.t,B.w,B.w,26,"orientierung")
B.vR=new A.at("TAL_28","Pflanzenkunde","Der Held wei\xdf alles \xfcber die Pflanze, auch besondere Wirkungen, und kann sie doppelt so lange haltbar machen wie \xfcblich.","Der Held verwechselt die Pflanze mit einer anderen.",B.t,B.K,B.ai,27,"pflanzenkunde")
B.vu=new A.at("TAL_29","Tierkunde","Der Held wei\xdf alles \xfcber das Tier.","Der Held glaubt, etwas \xfcber das Tier zu wissen, liegt aber gef\xe4hrlich falsch (sch\xe4tzt es ungiftig ein, obwohl es sehr giftig ist, oder als Pflanzenfresser, obwohl es Fleischfresser ist).",B.X,B.X,B.a0,28,"tierkunde")
B.vG=new A.at("TAL_30","Wildnisleben","Ein phantastischer Schlafplatz! Die Regeneration ist um 1 Punkt erh\xf6ht.","Das Lager wird \xfcberschwemmt oder von Ungeziefer heimgesucht.",B.X,B.ab,B.ai,29,"wildnisleben")
B.Bl=new A.dv(58333,"MaterialIcons",null,!1)
B.Jx=new A.hJ("Wissenstalente",B.Bl,3,"wissenstalente")
B.w1=new A.at("TAL_31","Brett- & Gl\xfccksspiel","Der Held gewinnt auf spektakul\xe4re Art und Weise. Wurde um Geld gespielt, verdoppelt sich sein Gewinn.","Der Held wird f\xe4lschlicherweise des Falschspiels verd\xe4chtigt oder hat eine Pechstr\xe4ne. Wird um Geld gespielt, verliert er mindestens den kompletten Einsatz (oder mehr).",B.t,B.t,B.w,30,"brettUndGluecksspiel")
B.w4=new A.at("TAL_32","Geographie","Der Held kennt viele Details der Region: Herrscher, Bev\xf6lkerungszahlen, Br\xe4uche, Flussverl\xe4ufe und Br\xfccken.","Der Held erinnert sich an v\xf6llig falsche geographische Details: Einwohnerzahlen von St\xe4dten stimmen nicht, Br\xfccken befinden sich an anderer Stelle als gedacht.",B.t,B.t,B.w,31,"geographie")
B.vQ=new A.at("TAL_33","Geschichtswissen","Der Held kennt besonders viele Details \xfcber ein bestimmtes Ereignis oder eine historische Person.","Der Held kann zu diesem Thema nur falsche Informationen beitragen: er irrt sich in Daten und Ereignissen.",B.t,B.t,B.w,32,"geschichtswissen")
B.vJ=new A.at("TAL_34","G\xf6tter & Kulte","Der Held hat detaillierte Einsichten in das Thema und kennt selbst spezielle Rituale, Gebetstexte oder philosophische Grundlagen.","Der Held verwechselt kultische Handlungen und Ansichten dieser Kirche mit einer anderen.",B.t,B.t,B.w,33,"goetterUndKulte")
B.wa=new A.at("TAL_35","Kriegskunst","Der Held hat einen vortrefflichen Plan, der ihm zus\xe4tzliche Vorteile im Kampf einbringt.","Der Held begeht einen kapitalen Planungsfehler, der den Kampf zu seinen Ungunsten beeinflusst oder ihm zumindest extreme Nachteile beschert.",B.X,B.t,B.w,34,"kriegskunst")
B.vN=new A.at("TAL_36","Magiekunde","Der Held kennt Herkunft, wirkenden Zauber und Ausl\xf6ser eines alten Artefaktes.","Der Held hat falsche Vorstellungen und irrt sich, sodass es zu einem gravierenden Fehlurteil kommt.",B.t,B.t,B.w,35,"magiekunde")
B.vT=new A.at("TAL_37","Mechanik","Der doppelte FW z\xe4hlt als FP.","Was immer der Held konstruieren wollte: Das Objekt ist gef\xe4hrlich oder die Konstruktion f\xe4llt in sich zusammen. Eine Falle wird mit gr\xf6\xdftm\xf6glichem Erfolg ausgel\xf6st.",B.t,B.t,B.K,36,"mechanik")
B.vx=new A.at("TAL_38","Rechnen","Schnelle und exakte Bestimmung der L\xf6sung","Das Ergebnis ist komplett falsch, der Held aber von der Richtigkeit absolut \xfcberzeugt.",B.t,B.t,B.w,37,"rechnen")
B.wl=new A.at("TAL_39","Rechtskunde","Der Held kennt sich mit Besonderheiten des Gesetzes aus und kann einen Plan entwickeln, es zu seinem Vorteil auszulegen.","Die Auslegung des Gesetzes ist falsch oder der Held \xfcbersieht einen wichtigen Passus.",B.t,B.t,B.w,38,"rechtskunde")
B.w9=new A.at("TAL_40","Sagen & Legenden","Der Held kann sich an viele Details der Geschichte erinnern und kennt mehrere Varianten.","Der Held verwechselt die Geschichte mit einer anderen oder meint sich an v\xf6llig andere Details zu erinnern.",B.t,B.t,B.w,39,"sagenUndLegenden")
B.wn=new A.at("TAL_41","Sph\xe4renkunde","Der Held erinnert sich an bemerkenswerte Details \xfcber einen einzelnen D\xe4mon oder den Weg in eine verborgene Globule.","Der Held unterliegt einer gef\xe4hrlichen Fehleinsch\xe4tzung.",B.t,B.t,B.w,40,"sphaerenkunde")
B.vw=new A.at("TAL_42","Sternkunde","Der Held kann sehr genau die Bewegungen der Himmelsk\xf6rper berechnen.","Eine Fehleinsch\xe4tzung bei einem Horoskop, einer Mondfinsternis etc.",B.t,B.t,B.w,41,"sternkunde")
B.Bh=new A.dv(57737,"MaterialIcons",null,!1)
B.Jy=new A.hJ("Handwerkstalente",B.Bh,4,"handwerkstalente")
B.vH=new A.at("TAL_43","Alchimie","Der Held wei\xdf exakt, welches Elixier er vor sich hat, welche Stufe es besitzt und wie lange haltbar es ist.","Das Elixier sorgt f\xfcr einen unangenehmen Nebeneffekt.",B.X,B.t,B.K,42,"alchimie")
B.w2=new A.at("TAL_44","Boote & Schiffe","Der Held nutzt g\xfcnstige Str\xf6mungen und Winde, um doppelt so schnell voranzukommen wie \xfcblich.","Der Held f\xe4llt von Bord oder ein wichtiger Teil des Wasserfahrzeugs wurde besch\xe4digt.",B.K,B.ab,B.aF,43,"booteUndSchiffe")
B.vU=new A.at("TAL_45","Fahrzeuge","Das Fahrzeug kommt gut voran und schafft die Strecke in Rekordzeit.","Das Fahrzeug erleidet einen Achsenbruch oder f\xe4llt w\xe4hrend der Fahrt mitsamt dem Fahrer um, und der Held erleidet Fallschaden.",B.a0,B.K,B.ai,44,"fahrzeuge")
B.wi=new A.at("TAL_46","Handel","Der Held bekommt die Ware zu einem Spottpreis bzw. kann sie zu Wucherpreisen loswerden - ohne dass sein Handelspartner es ihm \xfcbel nimmt. Die Preiserh\xf6hung oder der Nachlass sollte mindestens 50 % betragen.","Der Held wird \xfcber den Tisch gezogen oder der Handelspartner weigert sich, Gesch\xe4fte mit dem Helden zu machen. Die Preiserh\xf6hung oder der Nachlass sollte mindestens 50 % betragen.",B.t,B.w,B.a0,45,"handel")
B.wj=new A.at("TAL_47","Heilkunde Gift","Der Patient kann vollst\xe4ndig entgiftet werden, ohne dass der Held das passende Gegenmittel verwenden musste.","Der Held ordnet einen (sch\xe4dlichen) Aderlass an oder hat den Patienten bei der Behandlung verletzt oder gar zus\xe4tzlich vergiftet (1W6 SP).",B.X,B.t,B.w,46,"heilkundeGift")
B.vP=new A.at("TAL_48","Heilkunde Krankheiten","Der Patient ist geheilt, ohne dass der Held ein Heilmittel verwenden musste. Zudem steckt er sich nicht beim Erkrankten an.","Der Held hat dem Patienten bei der Behandlung geschadet (1W6 SP) oder der Krankheitsverlauf verschlimmert sich. Zudem besteht f\xfcr den Helden bei ansteckenden Krankheiten eine 25 % h\xf6here Chance, sich bei dem Patienten anzustecken.",B.X,B.w,B.ai,47,"heilkundeKrankheiten")
B.vS=new A.at("TAL_49","Heilkunde Seele","Der Patient kann einen Nachteil (Angst, Pers\xf6nlichkeitsschw\xe4che oder Schlechte Eigenschaft) f\xfcr einen ganzen Tag unterdr\xfccken.","Der Held hat den Patienten bei der Behandlung verst\xf6rt oder seinem Geist anderweitig geschadet. Der Patient erh\xe4lt f\xfcr einen Tag eine Stufe des Zustands *Furcht* oder *Verwirrung*.",B.w,B.a0,B.ai,48,"heilkundeSeele")
B.vK=new A.at("TAL_50","Heilkunde Wunden","Die vollen Fertigkeitspunkte werden bei der n\xe4chsten Regenerationsphase zus\xe4tzlich zur normalen Regeneration zu den Lebenspunkten des Patienten hinzuaddiert.","Der Held hat den Patienten bei der Behandlung verletzt (1W6 SP).",B.t,B.K,B.K,49,"heilkundeWunden")
B.vC=new A.at("TAL_51","Holzbearbeitung",u.x,u.B,B.K,B.ab,B.aF,50,"holzbearbeitung")
B.w3=new A.at("TAL_52","Lebensmittelbearbeitung","Die Mahlzeit ist ein echter Gaumenschmaus, ein gekelterter Wein ein wirklich edler Tropfen.","Das Essen schmeckt nicht nur miserabel, der Konsum hat auch eine schwere Magenverstimmung, Durchfall oder Brechreiz (1W6 SP) zur Folge.",B.w,B.K,B.K,51,"lebensmittelbearbeitung")
B.vA=new A.at("TAL_53","Lederbearbeitung",u.x,u.B,B.K,B.ab,B.ai,52,"lederbearbeitung")
B.vD=new A.at("TAL_54","Malen & Zeichnen","Das Bild ist so gut, dass der Held f\xfcr einen ber\xfchmten Maler gehalten wird.","schreckliches, unm\xf6glich erkennbares Gekrakel",B.w,B.K,B.K,53,"malenUndZeichnen")
B.w7=new A.at("TAL_55","Metallbearbeitung",u.x,u.B,B.K,B.ai,B.aF,54,"metallbearbeitung")
B.vv=new A.at("TAL_56","Musizieren","Der Held spielt eine Melodie, der keiner widerstehen kann und die alle Zuh\xf6rer in ihren Bann zieht.","Schreckliche, unheilvolle T\xf6ne werden dem Musikinstrument entlockt. M\xf6glicherweise wird das Instrument dabei besch\xe4digt. Menschen suchen das Weite oder wollen dem Musikanten das Instrument entrei\xdfen.",B.a0,B.K,B.ai,55,"musizieren")
B.vM=new A.at("TAL_57","Schl\xf6sserknacken","Das Schloss springt in Rekordzeit auf. Der Held ben\xf6tigt nur die H\xe4lfte des \xfcblichen Zeitaufwandes.","Der Dietrich bricht ab, die Falle wird ausgel\xf6st oder das Schloss verklemmt sich.",B.w,B.K,B.K,56,"schloesserknacken")
B.wg=new A.at("TAL_58","Steinbearbeitung",u.x,u.B,B.K,B.K,B.aF,57,"steinbearbeitung")
B.w6=new A.at("TAL_59","Stoffbearbeitung",u.x,u.B,B.t,B.K,B.K,58,"stoffbearbeitung")
